public boolean equals(Object right) {
  if (this == right) {
    return true;
  } else if (right == null || getClass() != right.getClass()) {
    return false;
  } else {
    DelegationKey r = (DelegationKey) right;
    return keyId == r.keyId &&
           expiryDate == r.expiryDate &&
           Arrays.equals(keyBytes, r.keyBytes);
  }
}
